post_content = "Designed for the active diver and the travel diver, the i450T has flexibility and intuition packed into an attractive design. Its features were crafted to be intuitive and easily navigated for an optimal dive experience. The optional hoseless gas integration de-clutters your dive for a more streamlined feel. Even small but thoughtful details were considered-- once you pair your transmitter, you’ll never need to pair it again. For all its meaningful engineering, the i450T hasn’t forgotten aesthetics - its sporty eye-catching design is easy to wear through life’s everyday adventures."
post_title = "i450T Dive Computer"
post_excerpt = "<ul>
 	<li>Multiple gas capability manages up to 3 Nitrox mixes (with 3 transmitters), each with individual PO2 set points</li>
 	<li>Automatic altitude adjustment ensures an accurate profile</li>
 	<li>Advanced watch functions including alternate time zone, stopwatch, lap timer, daily alarm, and countdown timer</li>
 	<li>Durable PVD (Physical Vapor Deposition) finish is extremely durable and resistant to wear (Black/Gray version)</li>
 	<li>Pre-Dive planning feature allows a preview of planned dives to confirm no-decompression limits</li>
 	<li>Automatic Safety Stop Countdown displayed in minutes and seconds for clarity</li>
 	<li>User changeable battery, with a data retention feature that maintains settings and calculations between battery changes</li>
</ul>
&nbsp;"
